import HomePage from './pages/home/App';
import ApartmentPage from './pages/apartment/App';
import ErrorPage from './pages/error/App';
import { createRouter, createWebHistory } from "vue-router";


const routes = [
  {
    path: '/',
    component: HomePage,
    name: 'homepages'
  },
  {
    path: '/apartments/:id',
    component: ApartmentPage,
    name: 'apartment'
  },
  {
    path: "/:catchAll(.*)",
    component: ErrorPage,
    name: 'error-page',
  }
]


const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router
